class EventHandler extends React.Component{

    clickHandler = (prop1, prop2) => {
        alert(prop1.type);
    }

    render() {
        return(
            <button onClick={(event) => (this.clickHandler("Goal", event))}>Click me to summon Event Handler</button>
        );
    }
}

export default EventHandler
